import {useState} from 'react'
import {FaSearch} from "react-icons/fa"
import './index.css'

const SearchMovie = () => {
  [searchedMovie, setSearchedMovie] = useState("")

  const setInput = event => {
    setSearchedMovie(event.target.value)
  }

  return (
    <div className="movies-search-box">
      <input type="text" placeholder="search movie" onChange={setInput} className="movies-input-bar" value={searchedMovie} />
      <FaSearch className="search-icon" />
    </div>
  )
}

export default SearchMovie
